import { useEffect,useState } from "react";
import axios from "axios";

export default function PersonFList(){
    const ulr = 'https://jsonplaceholder.typicode.com/users'
    const [usuarios,setUser] = useState([])

    useEffect(()=>{
        axios.get(ulr).then(req=>{
            const dadosusuarios=req.data
            setUser(dadosusuarios)
        })
    })
    return(
        <table className="tabela">
            <tr className="cabecalhoTabela">
                <td>Nome</td>
                <td>Email</td>
                <td>Acao</td>
            </tr>
            {usuarios.map(item=>
                <tr>
                    <td>{item.name}</td>
                    <td>{item.email}</td>
                    <td><button>Detalhes</button> <button>Excluir</button></td>
                </tr>
                )}
        </table>
    )
}
